//给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
//
// 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
//
//
//
// 示例 1:
//
//
//输入: s = "anagram", t = "nagaram"
//输出: true
//
//
// 示例 2:
//
//
//输入: s = "rat", t = "car"
//输出: false
//
//
//
// 提示:
//
//
// 1 <= s.length, t.length <= 5 * 10⁴
// s 和 t 仅包含小写字母
//
//
//
//
// 进阶: 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
// Related Topics 哈希表 字符串 排序 👍 463 👎 0


package leetcode.editor.cn;

import org.junit.jupiter.api.Assertions;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

public class ValidAnagram {
    public static void main(String[] args) {
        Solution solution = new ValidAnagram().new Solution();
        Assertions.assertEquals(false, solution.isAnagram("a", "ab"));
        Assertions.assertEquals(true, solution.isAnagram("a", "a"));
        Assertions.assertEquals(true, solution.isAnagram("ba", "ab"));
        Assertions.assertEquals(true, solution.isAnagram("anagram", "nagaram"));
        Assertions.assertEquals(false, solution.isAnagram("rat", "car"));
        Assertions.assertEquals(false, solution.isAnagram("d", "car"));

        Assertions.assertEquals(true, solution.isAnagram("",
                ""));
    }

    //leetcode submit region begin(Prohibit modification and deletion)
    class Solution {
        public boolean isAnagram(String s, String t) {
            char[] chars1 = s.toCharArray();
            char[] chars2 = t.toCharArray();
            HashMap<Character, Integer> hashMap1 = new HashMap<>();
            HashMap<Character, Integer> hashMap2 = new HashMap<>();
            for (int i = 0; i < chars1.length; i++) {
                hashMap1.put(chars1[i], hashMap1.getOrDefault(chars1[i], 0) + 1);
            }
            for (int i = 0; i < chars2.length; i++) {
                hashMap2.put(chars2[i], hashMap2.getOrDefault(chars2[i], 0) + 1);
            }
            if (hashMap1.size() != hashMap2.size()) {
                return false;
            }
            boolean result = true;
            Iterator<Map.Entry<Character, Integer>> iterator = hashMap1.entrySet().iterator();
            while (iterator.hasNext()) {
                Map.Entry<Character, Integer> next = iterator.next();
                Character character = next.getKey();
                Integer integer = next.getValue();
                if (!(hashMap2.containsKey(character) && hashMap2.get(character).equals(integer))) {
                    result = false;
                    break;
                }
            }
            return result;
        }
    }
//leetcode submit region end(Prohibit modification and deletion)

}
